        color1: "orange-200",
        color2: "orange-400",
        color3: "orange-600",
        color4: "amber-200",
        color5: "amber-400",
        color6: "amber-600"
    },
    Invierno: {
        color1: "blue-200",
        color2: "blue-400",
        color3: "blue-600",
        color4: "gray-200",
        color5: "gray-400",
        color6: "gray-600"
    },
};

export default palettes;
